import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Homelocal extends Component {
    constructor(props) {
        super(props);
        this.state = {
            userdata: [],
            date: new Date()
        }
    }
    componentDidMount() {
        fetch('/testuserdata')
            .then(res => res.json())
            .then(data => this.setState({ userdata: data }))
        this.getDate();
    }
    render() {
        return (
            <div>
                <h1>シフト希望</h1>
                ようこそ{this.state.userdata.username}さん
                <Link to="/Setting">設定</Link>

                <br></br>data確認------
                <div>{this.state.userdata.username}</div>
                <div>{this.state.userdata.userId}</div>
                <div>{this.state.userdata.displayName}</div>
                <div>{this.state.userdata.picture}</div>
                <div>{this.state.userdata.worktime}</div>
                <div>{this.state.userdata.administer}</div>
                ----------<br></br>

                <span id="dateText">{this.state.date.getFullYear()}月日～受付中</span>
                <button id="batu">×</button>
                <button id="sankaku">△</button>
                <button id="timeset">Time</button>
                <button id="prevMonth">前の月</button>
                <button id="nextMonth">次の月</button>
                <div id="calendar"></div>
                <div>
                    補足希望
                    <form>
                        <span name="dataday" data-dataday="8/1"></span>
                        <input type="textarea" name="comment"></input>
                        <button onclick="">登録</button>
                    </form>
                </div>

            </div>
        );
    }

    getDate() {
        const weeks = ['日', '月', '火', '水', '木', '金', '土']
        const date = new Date()
        let year = date.getFullYear()
        let month = date.getMonth() + 1
        console.log(year + "/" + month + "/" + date.getDate());
    }
}

export default Homelocal;
